import React, { useState } from "react";
import Button from "../navbar/styled/button";
import Nav from "../navbar/styled/bar";

// Navbar Component
const Navbar = (props) => {
  return (
    <>
      <Nav>
        <>
          <div className="array-inputs">
            <img id="size_logo" src="./media/size_pic.png" alt="size logo" />
            <input id="a_size" type="range" min={20} max={150} step={1} />
            <img
              id="speed_logo"
              src="./images/speed_pic.jpg"
              alt="speed logo"
            />
            <input id="a_speed" type="range" min={1} max={5} step={1} />
          </div>
          <Button id="a_generate" onClick={props.resetHandler}>
            Generate New Array
          </Button>
          <Button id="but_heap">Heap Sort</Button>
          <Button id="but_bubble">Bubble Sort</Button>
          <Button id="but_quick">Quick Sort</Button>
          <Button id="but_merge">Merge Sort</Button>
          <Button id="but_insertions">Insertion Sort</Button>
        </>
      </Nav>
    </>
  );
};

export default Navbar;
